import './App.scss';
import { Routes,Route} from 'react-router-dom';
import Layout from './components/Layout';
import Mainbar from './components/Mainbar';

function App() {
  return (
    <>
    <Routes>
    <Route path="/" element={<Layout />} />  
    <Route index element={<Mainbar />} />
    </Routes>
    </>
  );
}

export default App;
